svg.script:

var linesGroup = document.getElementById("linesGroup");

// Create and rotate lines every 10 degrees
for (var i = 0; i < 36; i++) {
  var line = document.createElementNS("http://www.w3.org/2000/svg", "line");
  line.setAttribute("x1", "80");
  line.setAttribute("y1", "0");
  line.setAttribute("x2", "80");
  line.setAttribute("y2", "80");
  line.setAttribute("stroke", "#000000");
  line.setAttribute("stroke-width", "1");
  line.setAttribute("id", "line" + (i + 2));
  line.setAttribute("transform", "rotate(" + (i * 10) + " 80 80)");
  linesGroup.appendChild(line);
}
